PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE drugs (
    id integer NOT NULL,
    drug_name character varying,
    compound_name character varying,
    pub_chem_id integer,
    molecular_formula character varying,
    molecular_weight numeric,
    cas character varying,
    log_p numeric,
    h_bond_donor_count integer,
    h_bond_acceptor_count integer,
    rotatable_bond_count integer,
    polar_surface_area numeric,
    heavy_atom_count integer,
    formal_charge integer,
    complexity numeric,
    defined_stereocenter_count integer,
    undefined_stereocenter_count integer,
    melting_point_range character varying,
    ld_50 numeric,
    smiles text,
    iupac_name text
);
COMMIT;
